                              value="+5.0"
                              onkeydown="return inputCheckNumOnly(event);"
                            />
                            <span className={cx("bold", "ml4px")}>%</span>
                          </td>
                          <td className={cx("taC", "blR")}>
                            <input
                              type="text"
                              id={style.MaxBuyCount}
                              className={cx("text_extrasmall", "taR")}
