                <table
                  className={cx("tbl_horizon")}
                  style={{ marginTop: "10px" }}
                >
                  <colgroup>
                    <col style={{ width: "160px" }}></col>
                  </colgroup>
                </table>
              </div>
            </div>
            <div
              className={cx("run_backtest_button")}
              style={{ marginTop: "30px" }}
